import { LoadingButton } from "@mui/lab";
import {
  TextField,
  Typography,
  FormControlLabel,
  Checkbox,
  Grid,
  Card,
} from "@mui/material";
import { Container, Box } from "@mui/system";
import React from "react";
import { Link } from "react-router-dom";

type CreateTaskPanelProps = {};

const CreateTaskPanel: React.FC<CreateTaskPanelProps> = () => {
  const handleSubmit = () => {};

  return (
    <Container>
      <Card
        sx={{
          marginTop: 8,
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
          <TextField
            margin="normal"
            required
            fullWidth
            id="email"
            label="Email Address"
            name="email"
            autoComplete="email"
            autoFocus
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="confirmPassword"
            label="Confirm Password"
            type="password"
            id="confirmPassword"
          />

          <FormControlLabel
            control={<Checkbox value="remember" color="primary" />}
            label="Remember me"
          />
          <LoadingButton
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2 }}
            //loading={loading}
          >
            Create Task
          </LoadingButton>
        </Box>
      </Card>
    </Container>
  );
};
export default CreateTaskPanel;
